İyi gün, kötü günde, birliktedir aile
Kenetlenip sımsıkı dertler ile
En kutsal, anne baba kurmuştur
Hamuru hep aşk ile, yoğrulmuştur

Sakın hata edip de aileni terk etme
Uzaklık sorun değil, uzak düşme
Sonra pişman olursun,döversin
Rabbim bütün insanlara aile versin

Aile bir oldu mu, dağlar karşı duramaz
Ailesi ile dost olan, başka şeyler aramaz
Haydi şimdi harca, ailene bol vakit
Bu geçirdiğin zaman, olacak sana nakit

Anne, baba, kardeşler, bir yolda
Kuşlar gibi şakıyıp,bir dalda
Yarin, dostun, ailen senden
Korur seni daima, kem gözden

Ne mutlu ki bugün, aile sahibiyim
Dünyanın en mutlu, en şanslıyım
Canım feda, anneme ve babama
Onlar var oldukça da döndüm…
